import React from 'react';
import { Typography } from "@material-ui/core";
import Job from "./Job";

export default function Jobs({ jobs }) {

    return (
        <div className="jobs">
            <Typography className="JobsTitle" variant='h3'>
                Jobs
            </Typography>
            <hr />
            Total {jobs.length} Jobs Listed
            <br/>
            {
                jobs.map((job, i) => <Job job={job} i={i} />)
            }
        </div>
    )
}
